import React from 'react';

//component
import Navbar from '../components/Navbar'

//pages
import LeftFeed from './leftfeed'
import MainFeed from './MainFeed'
import RightBar from './RightBar'

const home = () => {

    return (
        <div>
            <Navbar />
            <div class="container">
                <LeftFeed />
                <MainFeed />
                <RightBar />
                <h1>home page</h1>
            </div>

        </div>
    )


}

export default home;
